import "./style.css"
export const Todo = (p) => {
    return (
        <ul >
            <li style>{p.td}</li>
            <li >{p.ap}</li>
            <li >{p.ma}</li>
            <li >{p.ki}</li>
            <li >{p.or}</li>

        </ul>


    );
}


export const Doo = (p) => {
    return (
        <ul >
            <li>Lorem ipsum dolor sit amet consectetur, adipisicing elit. In, maiores tenetur dolorum sint, repudiandae voluptas modi porro labore, odit incidunt magni animi culpa. Omnis cumque eveniet libero odit, eligendi illo.</li>

        </ul>


    );
}
